import React, { Component } from "react";

class Carrinho extends Component {
  constructor() {
    super();
    this.state = {
      data: [],
    };
  }
  componentDidMount() {}

  render() {
    if (this.props.location.list.productsSelected) {
      var orderResume = this.props.location.list.productsSelected.map(
        (item, key) => {
          return (
            <li key={key}>
              <div className="cards-item">
                <div className="cards-item-aligment">
                  <span>{item.name}</span>
                  <small>{item.price}</small>
                </div>
              </div>
            </li>
          );
        }
      );
    }

    return (
      <div>
        <h1>Carrinho</h1>
        <div>
          <ul>{orderResume}</ul>
        </div>
      </div>
    );
  }
}

export default Carrinho;
